import React from 'react'
import { UseSelector } from 'react-redux/es/hooks/useSelector';

function card() {
  const {movie,loading}=UseSelector((state)=>state.MovieData);
  return (
    <div>
    
      {
        movie.map((ele)=>{
          <span className='movie_title'>{ele.title}</span>
        })
      }
    </div>
  )
}

export default card
